import React, { Component } from 'react';

//component
import TodoList from './component/TodoList';

//css
import './App.css'
class App extends Component {
  constructor() {
    super();
    this.todolist = [
      { title: "thuan di choi" },
      { title: "thuan o nha" },
      { title: "thuan di hoc" }
    ]
  }
  render() {
    return (
      <div className="todoapp">
        {
          this.todolist.map((item, index) =>
            <TodoList
              key={index}
              item={item.title}
            />
          )
        }

      </div>
    );
  }
}

export default App;
